import { Container, Row, Col, Tab, Nav } from "react-bootstrap";
import { ProjectCard } from "./ProjectCard";
import projImg1 from "../assets/img/project-img1.png";
import projImg2 from "../assets/img/project-img2.png";
import projImg3 from "../assets/img/project-img3.png";
import colorSharp2 from "../assets/img/color-sharp2.png";
import logo from "../assets/img/logo.jpeg";
import basketball from "../assets/img/gd.jpeg";
import charity from "../assets/img/charity.webp";
import recipi from "../assets/img/recipi.webp";



export const Projects = () =>{

    const projects= [ 
        {
            title: "Reflow Website",
            description: "Design & Development",
            imgUrl: logo,
          },
          {
            title: "Basket Social",
            description: "Design & Development",
            imgUrl: basketball,
          },
          {
            title: "Wecare NGO",
            description: "Design & Development",
            imgUrl: charity,
          },
          {
            title: "Recipies.com",
            description: "Design & Development",
            imgUrl: recipi,
          },

    ];

    const andprojects= [ 
        {
            title: "Around the Rim",
            description: "Design & Development",
            imgUrl: logo,
          },
          {
            title: "Air Patrol",
            description: "Design & Development",
            imgUrl: basketball,
          },
          {
            title: "Hacker News",
            description: "Design & Development",
            imgUrl: charity,
          },
          {
            title: "Tic Tac Toe",
            description: "Design & Development",
            imgUrl: recipi,
          },

    ];

    const mlprojects= [ 
        {
            title: "Reflow Website",
            description: "Design & Development",
            imgUrl: logo,
          },
          {
            title: "Basket Social",
            description: "Design & Development",
            imgUrl: basketball,
          },
          {
            title: "Wecare NGO",
            description: "Design & Development",
            imgUrl: charity,
          },
          {
            title: "Recipies.com",
            description: "Design & Development",
            imgUrl: recipi,
          },

    ];

    return(
        <section className="project" id="project">
            <Container>
                <Row>
                    <Col size={12}>
                    <h2> Projects</h2>
                    <p>All the projects available on GitHub</p>
                    <Tab.Container id="projects-tabs" defaultActiveKey="first">
                    <Nav variant="pills" className="nav-pills mb-5 justify-content-center align-items-center" id="pills-tab">
                    <Nav.Item>
                      <Nav.Link eventKey="first">Web</Nav.Link>
                    </Nav.Item>
                    <Nav.Item>
                      <Nav.Link eventKey="second">Android</Nav.Link>
                    </Nav.Item>
                    <Nav.Item>
                      <Nav.Link eventKey="third">ML</Nav.Link>
                    </Nav.Item>
                    </Nav>
                    <Tab.Content id="slideInUp">
                    <Tab.Pane eventKey="first">
                      <Row>
                        {
                          projects.map((project, index) => {
                            return (
                              <ProjectCard
                                key={index}
                                {...project}
                                />
                            )
                          })
                        }
                      </Row>
                        </Tab.Pane>
                    <Tab.Pane eventKey="second">
                    <Row>
                        {
                          andprojects.map((project, index) => {
                            return (
                              <ProjectCard
                                key={index}
                                {...project}
                                />
                            )
                          })
                        }
                    </Row>
                    </Tab.Pane>
                    <Tab.Pane eventKey="third">
                    <Row>
                        {
                          mlprojects.map((project, index) => {
                            return (
                              <ProjectCard
                                key={index}
                                {...project}
                                />
                            )
                          })
                        }
                      </Row>
                    </Tab.Pane>
                  </Tab.Content>
                 </Tab.Container>
                    </Col>
                    </Row>
            </Container>
            <img className="background-image-right" src={colorSharp2}></img>
        </section>

    )

}
